import React from "react";
import Link from "next/link";

const Header = (props) => (
  <header>
    <h1>This is my app header</h1>
    <nav>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/other">
        <a>Other Page</a>
      </Link>
    </nav>
  </header>
);

export default Header;
